import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPaperPlane, faEnvelope } from '@fortawesome/free-solid-svg-icons'
import "./firstWindow.css"

function FirstBody() {
  return (
    <div className="firstWindow">
        <div className="firstWindowfirst  Icon">
            <div className="paperPlaneDiv subIcon">
                <FontAwesomeIcon className="paperPlaneSVG subsubIcon" icon={faPaperPlane} size="10x" />
            </div>
        </div>
        <div className="firstWindowSecond Icon">
            <div className="createMailDiv subIcon">
                <FontAwesomeIcon className="envelopeSVG subsubIcon" icon={faEnvelope} size="10x" /> 
            </div>
        </div>
    </div>
  );
}

export default FirstBody;
